import Company_Logo from './files_to_modify/logo.png';

export default function Logo() {
    return(
        <div>
            <img src={Company_Logo} style={{
            alignItems: "baseline",
            height: 300,
            width: 300,
            justifyContent: 'center',
            alignItems: 'center',
            position: 'absolute', 
            bottom: 0, 
          }} alt="logo" />
        </div>
    )
 }
